import React from "react";
import ContentLoader from "react-content-loader";

const MyLoader = (props) => (
  <ContentLoader
    speed={3}
    width={400}
    height={150}
    viewBox="0 0 400 150"
    backgroundColor="#000000"
    foregroundColor="#ff9494"
    {...props}
  >
    <circle cx="20" cy="20" r="15" />
  </ContentLoader>
);

export default MyLoader;
